import React from "react";
import Navigation from "../../components/Navigation";

const Home = () => {
    return (
        <>
            <Navigation />
            <section className="container mx-auto px-4">
                <div className=" h-screen border-2">
                    <div>
                        <img src={require("../../assets/img/heroicon.png")} />
                    </div>
                    <div>kanan</div>
                </div>
            </section>
        </>
    );
};

export default Home;
